function Dashboard(props) {
    return (
        <div>
            <h2>Dashboard Page</h2>
            <h3>Username: {props.username}</h3>
            <h3>Password: {props.password}</h3>
            <Event username={props.username} password={props.password} />
        </div>
    )
}

export default Dashboard
